void play_this_sound() {
    const int CHANNEL_A = 0;
    const int CHANNEL_B = 1;
    const int PWM_FREQ_HZ = 20000;
    const int PWM_RES_BITS = 8;
    const unsigned long SAMPLE_RATE = 16000UL;
    const unsigned int SAMPLE_PERIOD_US = 1000000UL / SAMPLE_RATE;

    static bool initialized = false;
    if (!initialized) {
        ledcSetup(CHANNEL_A, PWM_FREQ_HZ, PWM_RES_BITS);
        ledcSetup(CHANNEL_B, PWM_FREQ_HZ, PWM_RES_BITS);
        ledcAttachPin(PWM_PIN_A, CHANNEL_A);
        ledcAttachPin(PWM_PIN_B, CHANNEL_B);
        ledcWrite(CHANNEL_A, 128);
        ledcWrite(CHANNEL_B, 128);
        initialized = true;
    }

    for (unsigned int i = 0; i < this_sound_len; ++i) {
        uint8_t c = pgm_read_byte_near(this_sound_cos + i);
        uint8_t s = pgm_read_byte_near(this_sound_sin + i);
        dacWrite(DAC_PIN_A, c);
        dacWrite(DAC_PIN_B, 255 - c);
        ledcWrite(CHANNEL_A, s);
        ledcWrite(CHANNEL_B, 255 - s);
        ets_delay_us(SAMPLE_PERIOD_US);
    }

    dacWrite(DAC_PIN_A, 128);
    dacWrite(DAC_PIN_B, 128);
    ledcWrite(CHANNEL_A, 128);
    ledcWrite(CHANNEL_B, 128);
}

